import React from "react";

const Help = () => {
  return (
    <div>
      <h3>Help Page</h3>
      <p>
        You can also provide your own generic filtering backend, or write an
        installable app for other developers to use. To do so override
        BaseFilterBackend, and override the .filter_queryset(self, request,
        queryset, view) method. The method should return a new, filtered
        queryset. As well as allowing clients to perform searches and filtering,
        generic filter backends can be useful for restricting which objects
        should be visible to any given request or user.
      </p>
    </div>
  );
};

export default Help;
